export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},V2AI4zqmnl:{data:{id:1004,attributes:{imdbId:"tt0083908",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjFkOTY5ZTktZWE1Ny00NTRhLWE1ZGEtZjdhZTFkOTZkOWU1XkEyXkFqcGdeQXVyNjUwOTM1OTY@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:1667,attributes:{title:a,plot:"Hercule Poirot (Sir Peter Ustinov) is called in to investigate a case for an insurance company regarding a dead woman's body found on a moor, and then an important diamond sent to the company to be insured, turns out to be a fake. Poirot discovers that the diamond was bought for Arlena Marshall (Dame Diana Rigg) by Sir Horace Blatt (Colin Blakely), and Arlena is on her honeymoon with her husband and stepdaughter on a Mediterranean island hotel. He joins them on the island and finds that everybody else starts to hate Arlena for different reasons, refusing to do a stage show, stopping a book, and for having an open affair with Patrick Redfern (Nicholas Clay), another guest, in full view of his shy wife. So it's only a matter of time before Arlena turns up dead, strangled, and Poirot must find out who it is.",slug:"evil-under-the-sun"}}},books:{data:[{id:5852,attributes:{title:a,description:"The classic Evil Under the Sun, one of the most famous of Agatha Christie’s Poirot investigations, has the fastidious sleuth on the trail of the killer of a sun-bronzed beauty whose death brings some rather shocking secrets into the light. The beautiful bronzed body of Arlena Stuart lay face down on the beach. But strangely, there was no sun and Arlena was not sunbathing…she had been strangled. Ever since Arlena’s arrival the air had been thick with sexual tension. Each of the guests had a motive to kill her, including Arlena’s new husband. But Hercule Poirot suspects that this apparent “crime of passion” conceals something much more evil.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kWoMZdqi524C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2006-10-03",publisher:"Harper Collins",subtitle:h}},{id:5853,attributes:{title:a,description:"It was not unusual to find the beautiful bronzed body of the sun-loving Arlena Stuart stretched out on a beach, face down. Only, on this occasion, there was no sun...she had been strangled. Ever since Arlena's arrival at the resort, Hercule Poirot had detected sexual tension in the seaside air. But could this apparent 'crime of passion' have been something more evil and premeditated altogether? Belgian detective Hercule Poirot interrupts his vacation on Smugglers' Island to help the local police invetigate the murder of an attractive woman.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VsjUBQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-01-01",publisher:i,subtitle:e}},{id:5854,attributes:{title:a,description:"When a shrewish stage star is found strangled at a posh island resort, detective Hercule Poirot is called in to investigate.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JzqaAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1941-01-01",publisher:"William Morrow Paperbacks",subtitle:h}},{id:5855,attributes:{title:"Evil Under the Sun: B2 (Collins Agatha Christie ELT Readers)",description:e,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RyrhywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2020-09-03",publisher:"Collins",subtitle:e}},{id:5856,attributes:{title:a,description:"Another murder mystery to be solved by the famous Hercule Poirot.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=D4oKVpj67zgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2001-01-01",publisher:i,subtitle:e}}]}}},meta:{}}},prerenderedAt:1681703555334}}("Evil Under the Sun","Agatha Christie","movie",null,"","series",1,"A Hercule Poirot Mystery","HarperCollins UK"))